constexpr int16_t row_size = 16*160*2;
constexpr uint8_t rows = 128/16;

void menuTick()
{
  if (gb.buttons.pressed(BUTTON_A))
  {
    startGame(0);
    CURRENT_SCREEN = GAME_SCREEN;
  }

  for (uint8_t row = 0; row < rows; row++)
  {
    uint16_t * buffer = row % 2 == 0 ? buffer1 : buffer2;
    
    memcpy(buffer, TITLE_IMAGE[row], row_size);
    
    if (row != 0) waitForPreviousDraw();
    
    drawScreenSlice(row * 16, 16, buffer);
  }

  waitForPreviousDraw();
}
